import math

def fib_simple(n):
    # O(2^n)
    n_fib = {
        1:1,
        2:2,
    }
    if n == 1 or n == 2:
        return 1
    return fib_simple(n-1) + fib_simple(n-2)


def fib_cache(n):
    # O(n)
    n_fib = {
        1:1,
        2:1,
    }
    def fib(n,n_fib):
        if n in n_fib:
            return n_fib[n]
        else:
            n_fib[n] = fib(n-1, n_fib) + fib(n-2, n_fib)
            return n_fib[n]
    return fib(n,n_fib)

def fib_loop(n):
    # O(n)
    if n == 1 or n ==2:
        return 1

    n_fib ={
        1:1,
        2:1,
    }
    def fib(n,n_fib):
        f1 = 1
        f2 = 1
        for i in range(2,n):
            f3 = f2 + f1
            f1 = f2
            f2 = f3
        return f2
    return fib(n, n_fib)

def fib_gold(n):
    # gold section formula: Fn = [ф^n/sqrt(5) + 1/2]
    # doesn't work with large numbers (flot is large)
    #O(1)
    fi = (1 + math.sqrt(5))/2
    return round(fi**n/math.sqrt(5))

